import React from "react";
import { Form } from "react-bootstrap";

const AddCommentForm = () => {
  return (
    <div>
      <h1>Comment form</h1>
      <p>You must be logged in in order to add a comment!</p>
      <Form>
        <input type="text" />
      </Form>
    </div>
  );
};

export default AddCommentForm;
